import React from 'react'
import Data from '../data/Data'

class FolderMain extends React.Component{
render(){
  console.log('testing props')
  console.log(this.props)
  return(
    <ul>
    {Data.notes.map(note=>
      <li>
        <h6>{note.name}</h6>
        <span>Modified {note.modified}</span>
      </li>)}
    </ul>
  )
}
}

export default FolderMain
